import './App.css';

const App = () => {
  return (
    <div className='app_wrapper'>
          <header className='header'>
            <img height='50px' src="https://camo.githubusercontent.com/5ebc638bb3e5113c5a87a5462197c35f40f7185ea9940e7723846b6e403f8a6b/68747470733a2f2f6372656174652d72656163742d6170702e6465762f696d672f6c6f676f2e737667"></img>
          </header>
          <nav className='nav'>
            <div>Profile</div>
            <div>Message</div>
            <div></div>
          </nav>
          <div className='content'>
              Main 
          </div>
    </div>
  );
}




export default App;
